INSERT INTO `mr_article` VALUES ('323', '20', '的撒打算倒萨的', '', '', 'admin', '2014-09-29 09:22:46', '6', '<p>倒萨倒萨倒萨倒萨倒萨</p>', '1', '', 'sda fsd afdsa fd', '0', null), ('324', '20', 'dsa dsa dsa ', '', '', 'admin', '2014-09-29 09:26:02', '1', '<p>dsa dsa dsa dsa&nbsp;<img src=\"http://img.baidu.com/hi/jx2/j_0038.gif\"/></p>', '1', '', 'sda fsd afdsa fd', '0', null), ('325', '20', 'dsadasdas', '', '', 'admin', '2014-09-29 09:29:02', '2', '<p>dsa das dsa d</p>', '1', '', 'sda fsd afdsa fd', '0', null), ('326', '20', 'dsa dsa fdsa fdsa ', '', '', 'admin', '2014-09-29 09:29:41', '4', '<p>fds fsad fsda fdsa&nbsp;</p>', '1', '', 'sda fsd afdsa fd', '0', null), ('327', '1', 'dsadsadsadasdsa', '', '', 'admin', '2014-10-02 21:58:24', '11', '<h3>盒子模型</h3>\n<p>CSS盒子模型描述了文档中元素各种矩形如何渲染。</p>\n<p>主要包含属性</p>\n<ul>\n<li>margin 外边据</li>\n<li>border 边线</li>\n<li>padding 内边距</li>\n<li>content 内容区域</li>\n</ul>\n<p>其中，margin、border、padding属性都分为上、下、右、左方向的单独属性定义。</p>\n<h3>盒子模型示意图</h3>\n<p><img src=\"boxdim.gif\" alt=\"CSS2规范盒子模型\" /></p>\n<h3>CSS2规范中描述的盒子模型</h3>\n<ul>\n<li>pading、margin、border宽度为0，各种边距重合。</li>\n<li>当我们给元素设置background(背景)时，content、padding显示背景颜色，而margin是一个透明区域。</li>\n</ul>\n<h3>包含元素的高度是由子节点内容决定的</h3>\n<pre><code>&lt;div id=\"a\"&gt;\n    &lt;div id=\"a1\"&gt;12&lt;/div&gt;\n    &lt;div id=\"a2\"&gt;13&lt;/div&gt;\n&lt;/div&gt;\n</code></pre>\n<p>注意：ID=a当设置了高度，此时内部元素高度超过ID=a元素，内容将出现溢出的情况，原因是每个元素的z-index值。</p>\n<h3>margin-width值的类型</h3>\n<ul>\n<li>length: 指定一个固定的宽度，允许有负值</li>\n<li>percentage: 百分比</li>\n<li>auto：边距计算，该计算方案在CSS规范中有详细的说明。</li>\n</ul>\n<h3>什么是包含块</h3>\n<p>一个元素的尺寸和位置的计算有时相对于某个特定的长方形，称为该元素的<strong>包含块</strong>。</p>\n<h3>外边距属性(margin)</h3>\n<p>外边距的值类型是margin-width，参考:<strong>margin-width值的类型</strong></p>\n<ul>\n<li><p>四边：margin-top、margin-right、margin-bottom、margin-left</p>\n</li>\n<li><p>缩写：margin</p>\n</li>\n<li><p>一个值：应用于四边</p>\n</li>\n<li><p>两个值：第一个值上、下边距，第二个值左右边距</p>\n</li>\n<li><p>三个值：第一个值上边距，第二个值左右边距，第三个值下边距</p>\n</li>\n<li><p>四个值：它们分别设置上，右，下，左边距</p>\n</li>\n</ul>\n<pre><code>/* 四个方向边距的设置 */\nBODY {\n  margin-top: 1em;\n  margin-right: 2em;\n  margin-bottom: 3em;\n  margin-left: 2em;        /* 从相对边（右边）拷贝而来 */\n}\n</code></pre>\n<pre><code>```\n/* 缩写外边据 */\nBODY { margin: 2em }         /* 四个边距都设置为2em */\nBODY { margin: 1em 2em }     /* top &amp; bottom = 1em, right &amp; left = 2em */\nBODY { margin: 1em 2em 3em } /* top=1em, right=2em, left=2em, bottom=3em */\n</code></pre>\n<p>注意： margin是margin-top、margin-right、margin-bottom、margin-left的缩写属性。</p>\n<h3>两个块外边距重合</h3>\n<p>边距重合是两个或多个框（相邻或嵌套）的相邻的边距（其间没有边白或边框间隔）重合在一起而形成一个单一的边距。</p>\n<ul>\n<li><p>水平边距永远不会重合</p>\n</li>\n<li><p>垂直边距可能在特定的块之间重合</p>\n<ul>\n<li>常规流向中两个或多个块相邻的垂直边距会重合。结果的边距宽度是相邻边距宽度中较大的值。如果出现负边距，则在最大的正边距中减去绝对值最大的负边距。如果没有正边距，则从零中减去绝对值最大的负边距。</li>\n<li>在一个浮动框和其它块之间的垂直边距不重合。</li>\n<li>绝对和相对定位的块的边距不重合。</li>\n</ul>\n</li>\n<li><p>垂直块的边距重合</p>\n<pre><code>&lt;!DOCTYPE html&gt;\n&lt;html&gt;\n&lt;head&gt;\n&lt;title&gt;&lt;/title&gt;\n&lt;style type=\"text/css\"&gt;\n    div{height: 30px;}\n    .a{\n        background: red;\n        margin-bottom: 100px;\n    }\n    .b{\n        background: #0000ff;\n        margin-top: 50px;\n    }\n&lt;/style&gt;\n&lt;/head&gt;\n&lt;body&gt;\n&lt;div class=\"a\"&gt;a&lt;/div&gt;\n&lt;div class=\"b\"&gt;b&lt;/div&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n</code></pre>\n<p>Chrome浏览情况：a和b的上下边距为100px\n<br  /><img src=\"20140526092626.gif\" alt=\"垂直外边距问题\" /></p>\n</li>\n<li><p>包含块的边距重合</p>\n<pre><code>&lt;!DOCTYPE html&gt;\n&lt;html&gt;\n&lt;head&gt;\n&lt;title&gt;&lt;/title&gt;\n&lt;style type=\"text/css\"&gt;\n    .a{\n        height: 60px;\n        background: red;\n    }\n    .b{\n        height: 30px;\n        background: #0000ff;\n        margin-top: 50px;\n    }\n&lt;/style&gt;\n&lt;/head&gt;\n&lt;body&gt;\n&lt;div class=\"a\"&gt;\n&lt;div class=\"b\"&gt;b&lt;/div&gt;\n&lt;/div&gt;\n&lt;/body&gt;\n&lt;/html&gt;\n</code></pre>\n<p>Chrome浏览情况，这是Web开发中经常遇到的\n<br  /><img src=\"20140526095258.jpg\" alt=\"包含块边距重合\" /></p>\n</li>\n</ul>\n<p>有一种说法叫：边距的重合造成边距的崩溃。</p>\n<h3>边线属性(border)</h3>\n<p>我们可以定义边框样式，宽度、颜色、表现样式。</p>\n<ul>\n<li><p>border-width</p>\n<ul>\n<li>thin 一个窄的边框。</li>\n<li>medium 一个中等的边框。</li>\n<li>thick 一个厚边框。</li>\n<li>length 边框的厚度是显式值。显式的边框宽度不能为负数。</li>\n</ul>\n</li>\n<li><p>border-style</p>\n<ul>\n<li>none 没有边框。该值迫使\'border-width\'的计算值为0。 to be \'0\'.</li>\n<li>hidden 和\'none\'相似，除非在表格元素中解决边框冲突时。</li>\n<li>dotted 边框是一系列的点。</li>\n<li>dashed 边框是一系列的短线条的段。</li>\n<li>solid  边框是一条单一的线。</li>\n<li>double 边框有两条实线。两条线宽和其中的空白的宽度之和等于border-width的值。</li>\n<li>groove 边框看上去好象是雕刻在画布之内。</li>\n<li>ridge  和grove相反：边框看上去好象是从画布中凸出来。</li>\n<li>inset  该边框使整个框看上去好象是嵌在画布中。</li>\n<li>outset 和inset相反：该边框使整个框看上去好象是从画布中凸出来。所有的边框画在框的背景之上。groove，ridge，inset和outset类型的边框的颜色取决于元素的color属性。和CSS一致的用户端可能将dotted，dashed，double\'，\'groove\'，\'ridge\'，\'inset\'及\'outset\'为\'solid\'。</li>\n</ul>\n</li>\n<li><p>border-color</p>\n</li>\n</ul>\n<h3>内边距属性(margin)</h3>\n', '1', '', 'sda fsd afdsa fd', '1', '### 盒子模型\n\nCSS盒子模型描述了文档中元素各种矩形如何渲染。\n\n主要包含属性\n- margin 外边据\n- border 边线\n- padding 内边距\n- content 内容区域\n\n其中，margin、border、padding属性都分为上、下、右、左方向的单独属性定义。\n\n\n### 盒子模型示意图\n\n![CSS2规范盒子模型](boxdim.gif)\n\n### CSS2规范中描述的盒子模型\n\n- pading、margin、border宽度为0，各种边距重合。\n- 当我们给元素设置background(背景)时，content、padding显示背景颜色，而margin是一个透明区域。\n\n\n### 包含元素的高度是由子节点内容决定的\n```\n<div id=\"a\">\n    <div id=\"a1\">12</div>\n    <div id=\"a2\">13</div>\n</div>\n```\n注意：ID=a当设置了高度，此时内部元素高度超过ID=a元素，内容将出现溢出的情况，原因是每个元素的z-index值。\n\n\n### margin-width值的类型\n\n- length: 指定一个固定的宽度，允许有负值\n- percentage: 百分比\n- auto：边距计算，该计算方案在CSS规范中有详细的说明。\n\n\n### 什么是包含块\n\n一个元素的尺寸和位置的计算有时相对于某个特定的长方形，称为该元素的**包含块**。\n\n### 外边距属性(margin)\n\n外边距的值类型是margin-width，参考:**margin-width值的类型**\n\n- 四边：margin-top、margin-right、margin-bottom、margin-left\n\n- 缩写：margin\n   - 一个值：应用于四边\n   - 两个值：第一个值上、下边距，第二个值左右边距\n   - 三个值：第一个值上边距，第二个值左右边距，第三个值下边距\n   - 四个值：它们分别设置上，右，下，左边距\n\n```\n/* 四个方向边距的设置 */\nBODY {\n  margin-top: 1em;\n  margin-right: 2em;\n  margin-bottom: 3em;\n  margin-left: 2em;        /* 从相对边（右边）拷贝而来 */\n}\n```\n\n```\n/* 缩写外边据 */\nBODY { margin: 2em }         /* 四个边距都设置为2em */\nBODY { margin: 1em 2em }     /* top & bottom = 1em, right & left = 2em */\nBODY { margin: 1em 2em 3em } /* top=1em, right=2em, left=2em, bottom=3em */\n```\n\n\n注意： margin是margin-top、margin-right、margin-bottom、margin-left的缩写属性。\n\n### 两个块外边距重合\n\n边距重合是两个或多个框（相邻或嵌套）的相邻的边距（其间没有边白或边框间隔）重合在一起而形成一个单一的边距。\n\n- 水平边距永远不会重合\n\n- 垂直边距可能在特定的块之间重合\n	- 常规流向中两个或多个块相邻的垂直边距会重合。结果的边距宽度是相邻边距宽度中较大的值。如果出现负边距，则在最大的正边距中减去绝对值最大的负边距。如果没有正边距，则从零中减去绝对值最大的负边距。\n	- 在一个浮动框和其它块之间的垂直边距不重合。\n	- 绝对和相对定位的块的边距不重合。\n\n\n1. 垂直块的边距重合\n```\n<!DOCTYPE html>\n<html>\n<head>\n    <title></title>\n    <style type=\"text/css\">\n        div{height: 30px;}\n        .a{\n            background: red;\n            margin-bottom: 100px;\n        }\n        .b{\n            background: #0000ff;\n            margin-top: 50px;\n        }\n    </style>\n</head>\n<body>\n<div class=\"a\">a</div>\n<div class=\"b\">b</div>\n</body>\n</html>\n```\nChrome浏览情况：a和b的上下边距为100px\n![垂直外边距问题](20140526092626.gif)\n\n\n2. 包含块的边距重合\n```\n<!DOCTYPE html>\n<html>\n<head>\n    <title></title>\n    <style type=\"text/css\">\n        .a{\n            height: 60px;\n            background: red;\n        }\n        .b{\n            height: 30px;\n            background: #0000ff;\n            margin-top: 50px;\n        }\n    </style>\n</head>\n<body>\n<div class=\"a\">\n    <div class=\"b\">b</div>\n</div>\n</body>\n</html>\n```\nChrome浏览情况，这是Web开发中经常遇到的\n![包含块边距重合](20140526095258.jpg)\n\n有一种说法叫：边距的重合造成边距的崩溃。\n\n### 边线属性(border)\n\n我们可以定义边框样式，宽度、颜色、表现样式。\n\n- border-width\n	- thin 一个窄的边框。\n	- medium 一个中等的边框。\n	- thick 一个厚边框。\n	- length 边框的厚度是显式值。显式的边框宽度不能为负数。\n\n- border-style\n	- none 没有边框。该值迫使\'border-width\'的计算值为0。 to be \'0\'.\n	- hidden 和\'none\'相似，除非在表格元素中解决边框冲突时。\n	- dotted 边框是一系列的点。\n	- dashed 边框是一系列的短线条的段。\n	- solid  边框是一条单一的线。\n	- double 边框有两条实线。两条线宽和其中的空白的宽度之和等于border-width的值。\n	- groove 边框看上去好象是雕刻在画布之内。\n	- ridge  和grove相反：边框看上去好象是从画布中凸出来。\n	- inset  该边框使整个框看上去好象是嵌在画布中。\n	- outset 和inset相反：该边框使整个框看上去好象是从画布中凸出来。所有的边框画在框的背景之上。groove，ridge，inset和outset类型的边框的颜色取决于元素的color属性。和CSS一致的用户端可能将dotted，dashed，double\'，\'groove\'，\'ridge\'，\'inset\'及\'outset\'为\'solid\'。\n\n- border-color\n\n\n\n\n### 内边距属性(margin)\n'), ('328', '20', '模板引擎引用各作用域对象', '', '', 'admin', '2014-10-04 09:25:27', '12', '<p>dsad sa das&nbsp;<img src=\"http://img.baidu.com/hi/jx2/j_0059.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0074.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0075.gif\"/></p>', '1', null, 'sda fsd afdsa fd', '0', null), ('329', '1', 'dsadsadasdsadsadsad', '', '', 'admin', '2014-10-04 15:39:54', '4', '<p>▍dsasadsad</p>', '1', '', 'sda fsd afdsa fdsda fsd afdsa fd', '0', null), ('330', '16', 'Core架构更新', '', '', 'admin', '2014-10-04 18:33:20', '12', '<p>的撒的撒的撒的撒，你猜猜看！</p><pre class=\"brush:css;toolbar:false\">的撒旦\nd的撒\nd撒\n的撒\nd撒</pre><p><br/></p>', '1', '', 'sda fsd afdsa fd', '0', null), ('331', '15', '测数据哦更新欧美', '', '', 'admin', '2014-10-04 18:33:46', '9', '<p>的撒的撒的撒</p>', '1', '', 'sda fsd afdsa fd', '0', null), ('332', '17', '的撒的撒的撒', '', '', 'admin', '2014-10-04 18:39:04', '8', '<p>的撒的撒的撒的撒的撒<img src=\"http://img.baidu.com/hi/jx2/j_0049.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0040.gif\"/></p>', '1', '', 'sda fsd afdsa fd', '0', null), ('333', '16', 'dsa das das ', '', '', 'admin', '2014-10-04 18:53:37', '5', '<p>dsa dsa dsa&nbsp;</p>', '1', '', 'sda fsd afdsa fd', '0', null), ('334', '16', 'dsa das dsa fdas fds a', '', '', 'admin', '2014-10-04 18:53:49', '12', '<p>fds afdsa fdsa fads fs afds afd</p>\n', '1', '', 'sda fsd afdsa fd', '1', 'fds afdsa fdsa fads fs afds afd '), ('335', '11', '倒萨倒萨打算倒萨但是a', '倒萨d', '倒萨的撒旦撒倒萨', 'admin', '2014-11-16 12:00:14', '3', '<p>倒萨倒萨打算倒萨倒萨倒萨</p>', '1', null, ' 倒萨倒萨', '0', null);
